//     newContact.save((err, contact) => {
//         if (err) {
//             res.send(err);
//         }
//         res.json(contact);
//     });
// };

export const getContacts = async (req, res) => {
    try {
        let contacts = await Contact.find({}); // Utiliser await sans callback
        res.json(contacts);
    } catch (err) {
        res.send(err);
    }
};
