export const updateContact = async (req, res) => {
    try {
        let contact = await Contact.findOneAndUpdate({ _id: req.params.contactId }, req.body, { new: true } // Utiliser await sans callback
        );
        res.json(contact);
    } catch (err) {
        res.send(err);
    }
};
